INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('e22d81bc-4bf6-49db-9c21-39edc165db04', 'Swanlaab Venture Factory', '"Swanlaab, founded in 2014 with a unique international team, combining extensive investment and entrepreneurial experience from Madrid and Tel Aviv. Specializing in B2B ventures, Swanlaab harnesses its exceptional entrepreneurial background to aid founders in scaling their businesses. Understanding that success is not merely an art, but a meticulously crafted process, Swanlaab is committed to supporting companies from their inception and throughout their journey. Swanlaab''s funds and investment strategies are tailored to address three key challenges in the Spanish business ecosystem: fostering technological innovation across various sectors, with a particular emphasis on the vital agri-food sector, and supporting succession planning within family-owned businesses. B2B SOFTWARE Swanlaab Tech Fund II invests in cutting-edge technologies to help Spanish startups become global leaders, focusing on enterprise software and B2B models. By actively collaborating with founders and leveraging its B2B entrepreneurial experience, Swanlaab operates as a company builder, driving success for Spanish startups. AGRI-FOOD TECH Swanlaab Agrifood Tech I is a fund specialized in the science and technology of the agri-food vertical. Upholding the same principles of operational support and company building, it focuses on innovation within the value chain of the sector, making investments ranging from concept -testing to series A. SEARCH FUND Scipio Swanlaab invests globally in Search Funds, attracting talented individuals or teams to acquire and lead businesses, providing funding for the search phase and acquisition. Sector-agnostic, it aims to buy growing businesses with competitive advantages at attractive valuations, managed by Swanlaab with Scipio as investment advisor."', 'http://www.swanlaab.com', '[]'::jsonb, '[]'::jsonb, 'http://www.linkedin.com/company/3524806', '2025-12-25T17:44:48.904Z', 'com_69c9e606-a1ca-46dc-adc6-ea6f68cd3ebc', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_dbc35f0d-7ac7-4315-9d45-ec8a415ceaba","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:21.421Z', 'folk', '2025-12-25T18:26:52.224Z', 'Spain', 'Cybersecurity, EdTech, Product Information Management, Fleet Management, IoT, HealthTech, Chatbots, FinTech', '["info@swanlaab.com"]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://swanlaab.com/","http://www.linkedin.com/in/martinhuntsr"]'::jsonb, '{"Title":"CEO, Swanlaab USA Ventures","Rounds":"Series A, Series B","Status":null,"Country":"Spain, Israel","Fund HQ":"Spain","VC Logo":null,"Website":"http://www.swanlaab.com","Linkedin":"http://www.linkedin.com/company/3524806","Country 1":"Spain","Country 2":"Israel","Last Name":"Hunt","First Name":"Martin","HQ Location":"Spain","Funding Stage":"Series A/B","Investor City":"Philadelphia","Investor Type":"VC Firm","Investor State":"Pennsylvania","Portfolio Link":"https://swanlaab.com/portfolio/","Investment Size":null,"Investor''s Country":"United States","Recent Investments":"Pack2Earth, flowww, RepScan, KOA Biotech, WEECOVER","Typical Investment":"€100k-€1.5M","Person Linkedin Url":"http://www.linkedin.com/in/martinhuntsr","Company Linkedin Url":"http://www.linkedin.com/company/swanlaab-venture-factory","Num Lead Investments":"17","Partners'' LinkedIn Profile":"https://www.linkedin.com/in/asantos123/","Total Number of Investments":"30","Partners'' LinkedIn Profile (2)":"https://www.linkedin.com/in/juanrevuelta/","Partners'' LinkedIn Profile (3)":"https://www.linkedin.com/in/xanabelastegui/"}'::jsonb, 'not_enriched') ON