INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('879360a0-7b33-4878-a16b-0210eb1f2cde', 'Extension Fund', '"Extension Fund is a pioneering venture debt firm based in Madrid and Barcelona, specializing in supporting bold entrepreneurs aiming to build global companies. They forge long-term partnerships with portfolio companies, leveraging their extensive knowledge, experience, and network to drive growth and success. Extension Fund operates as a hybrid debt fund, investing through convertible notes and venture debt, tailored for companies from pre-seed to Series B stages. They invest from €100k to €3M in companies with global potential at different stages; through convertible notes in earlier stages or venture debt in more mature startups. In their Seed Pocket initiative, Extension Fund partners early on with high-potential companies expected to raise several rounds of funding. They utilize convertible notes as a form of short-term financing with the final purpose of conversion into equity, typically in a future round. Additionally, their venture debt offering provides debt financing for venture-backed companies at more flexible terms than traditional financing, supporting companies in scaling their operations effectively."', 'https://www.extensionfund.com/', '[]'::jsonb, '[]'::jsonb, 'https://es.linkedin.com/company/extension-fund', '2025-12-25T17:37:10.940Z', 'com_e2778187-b4f8-43cb-abdb-09529de2a9fe', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:10.654Z', 'folk', '2025-12-25T17:37:10.940Z', 'Spain', 'Fintech, Insurtech, Proptech, Cleantech, E-commerce', '[]'::jsonb, '[]'::js